    const [error, setError] = useState(''); 
    const [message, setMessage] = useState(''); 

    const handleInputChange = (e) => {
        setPassword(e.target.value);
    };

    const handleSubmit = async (e) => { 
        e.preventDefault();
    }
};

export default ResetPassword;
